import React from "react";
import imageLoad from "../assests/imageLoad.jpg"

function Card({movie}) {
    const imgSrc = `https://image.tmdb.org/t/p/original${movie.poster_path}`
    return ( 
        <div >
            {movie.poster_path == null 
            ?
            <img src={imageLoad} alt={movie.original_title} width={'0%'} />
            : 
            <img src={imgSrc} alt={movie.original_title} width={'20%'} />
            }
            <p>{movie.original_title}</p>
        </div>
     );
}

export default Card;
